let values = [];
for (const item of $input.all()) {
  values.push(
    {"option": item.json.name}
  );
}

return {
  json: {
    "values": values
  }
};

let credentials = [];
const wf = $input.first().json;
const seen = new Set();

for (const node of wf.nodes) {
  const credsObj = node.credentials || {};

  for (const [credentialType, cval] of Object.entries(credsObj)) {
    if (!cval || (typeof cval !== 'object')) continue;
    const credentialId = cval.id ?? null;
    const credentialName = cval.name ?? null;
    if (!seen.has(credentialId)) {
      seen.add(credentialId);
      credentials.push({
        credentialType,
        credentialName,
        credentialId
      });
    }
  }

}

return credentials;

let wf = JSON.stringify($('Workflow to Export Ready').first());

for (const item of $input.all()) {

  for (const oldcred of $('Credentials to Export').all()) {
    if (oldcred.json.name === item.json.name) {
      wf = wf.replaceAll(oldcred.json.id, item.json.id);
    }
  }

}

return JSON.parse(wf);

const wf = $input.first().json;
const cleaned = [];

for (const node of wf.nodes || []) {
  if (node.parameters && node.parameters.workflowId) {
    const wfObj = node.parameters.workflowId;

    if (!cleaned.find(c => c.id === wfObj.value)) {
      cleaned.push({
        id: wfObj.value,
        name: wfObj.cachedResultName
      });
    }
  }
}

return cleaned.map(c => ({ json: c }));

const source = $('Sub-Workflows').all();
const target = $input.all();

const sourceNames = source.map(s => s.json.name);
const targetNames = target.map(t => t.json.name);

const missing = sourceNames.filter(n => !targetNames.includes(n));

return {
  json: {
    missing
  }
};

let subs = [];
