  for (const allswf of $('Sub-Workflows').all()) {
    if (foundswf.json.name === allswf.json.name) {
      subs.push({
        id: foundswf.json.id,
        oldid: allswf.json.id,
        name: foundswf.json.name
      });
    }
  }

}

return subs;

